
import java.util.ArrayList;

public class Arraylistconcept {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		ArrayList <String> obj = new ArrayList<String>();
		
		obj.add("sathish");
		
		obj.add("ashwin");
		
		obj.add("gowri");
		
		for (String e:obj)
		{
			
			System.out.println(e);
		}
	}

}
